import React from 'react';
import classes from './Dialogs.module.css';
import { NavLink } from 'react-router-dom';

const DialogItem = (props) =>
{
    return(
    <NavLink className={classes.item} activeClassName={classes.active} to={'/dialogs/'+props.id}>{props.name}</NavLink>
    )
}

const Message = (props) => {
    return(
        <div>{props.message}</div>
    )
}
const Dialogs = (props) => {
return(
    <div className={classes.dialogs}>
        <div className={classes.dialogs.item}>
            <b>
<div><DialogItem name='User1' id='1' />  </div>
<div><DialogItem name='User2' id='2' />  </div>
<div><DialogItem name='User3' id='3' />  </div>
<div><DialogItem name='User4' id='4' />  </div>
<div><DialogItem name='User5' id='5' />  </div>

</b>
        </div>
        <div>
  <Message message='hi' />
  <Message message='How are you?' />
  <Message message='hi' />
  </div>
    </div>

)
}

export default Dialogs;
